import React from "react";
import { Link } from "react-router-dom";
import HomeImageAccueil from "../assets/image-accueil.png";

import image from "../assets/image-accueil.png";
import products from "../data/logements.json";
import Herobanner from "../components/Header/Herobanner";
import Thumbnails from "../components/Card/Thumbnails";


const Home = () => {
  return (
    <div className="home">
      <div className="home__banner">
        <Herobanner image={image} />
      </div>{" "}
      <section className="home__products">
        {products.map((product) => {
          return (
            <article key={product.id}>
              <Link to={`/products/${product.id}`}>
                <Thumbnails image={product.cover} title={product.title} />
              </Link>
            </article>
          );
        })}
      </section>
    </div>
  );
};

export default Home;
